import React, { useEffect } from 'react';
import {
  AppBar, Toolbar, CircularProgress,
  withStyles
} from '@material-ui/core';

const Viewer = (props) => {
  const {
    classes, loadData, isLoading
  } = props;

  useEffect(() => { loadData() }, []);

  return (
    <div className={classes.container}>
      <AppBar position="sticky">
        <Toolbar>
          <div>Research bar</div>
        </Toolbar>
      </AppBar>
      {
        isLoading ? 
        <CircularProgress />
        :
        <div>
          Listing
        </div>
      }
    </div>
  )
};

const styles = {
  container: {
    display: 'flex',
    flex: 1,
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center'
  }
}

export default withStyles(styles)(Viewer);
